  \"detroit-lakes-wetland-management-district-annual-narrative-report-calendar-year-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Detroit
  Lakes Wetland Management District outlines District accomplishments during the 1988
  calendar year. The report begins by giving brief District highlights and describing
  the climate and habitat conditions in the District, as well as the land acquisition
  program, funding, and system status. The planning section details the master plan,
  management plan, public participation, compliance with environmental mandates, and
  research and investigation. Administration describes personnel, youth programs,
  other manpower programs, funding, safety, and technical assistance. The habitat
  management section discusses wetlands, croplands, grasslands, haying, prescribed
  fire, vegetation control, and easements for waterfowl management. Wildlife- including
  endangered and threatened species, migratory birds, game mammals, and animal control-
  are discussed. The public relations sections describes information and interpretation,
  recreational uses, and enforcement. The construction and maintenance section describes
  recent construction, rehabilitation, equipment utilization and replacement, energy
  conservation, communications systems, and computer systems. Cooperative programs
  and items of interest are discussed. Photographs and brochures are attached.\",\n\t\"license_title\":
